'use strict';
$(window).load(function () {
  $('.loader').delay(500).fadeOut('slow');
});


$(document).ready(function () {

  'use strict';

  var wow = new WOW({
    animateClass: 'animated',
    offset: 10,
    mobile: true
  });
  wow.init();

  $('.navbar-nav>li>a').on('click', function () {
    $('.navbar-collapse').collapse('hide');
  });

  $(window).on('scroll', function () {
    if ($(window).scrollTop() < 100) {
      $('.header').removeClass('sticky_header');
    } else {
      $('.header').addClass('sticky_header');
    }
  });

  $('.counter').counterUp({
    delay: 5,
    time: 3000
  });

  $(".countdown")
    .countdown("2019/11/21", function (event) {
      $(this).html(
        event.strftime('<div>%D <span>Days</span></div>  <div>%H<span>Hours</span></div> <div>%M<span>Minutes</span></div> <div>%S<span>Seconds</span></div>')
      );
    });
    
  $(".cover_slider").owlCarousel({
    loop: false,
    autoplay: true,
    smartSpeed: 1000,
    autoplayHoverPause: false,
    dots: true,
    nav: false,
    items: 1,
    animateOut: 'fadeOut',
    animateIn: 'fadeIn',
    dotsContainer: '.cover_dots'
  });
});

$('#bootstrapForm').submit(function (event) {
  event.preventDefault()
  var extraData = {}
  $('#bootstrapForm').ajaxSubmit({
    data: extraData,
    dataType: 'jsonp',
    error: function () {
      alert('Form Submitted. Thanks.')
      window.location = 'http://titiksha.tech'
    }
  })
});
